const wishListGames = [];

let id = 11;

module.exports = {
  getAllGames(req, res) {
    res.status(200).send(games);
  },
  addToWishList(req, res) {
    const { title, logo, info, note, id } = req.body;
    const wishListGame = { title, logo, info, note, id };
    wishListGames.push(wishListGame);
    res.status(200).send(wishListGames);
  },
  deleteFromWishList(req, res) {
    let { id } = req.params;

    let index = wishListGames.findIndex(game => game.id === +id);
    wishListGames.splice(index, 1);
    res.status(200).send(wishListGames);
  },
  addNote(req, res) {
    let { input } = req.params;

    games.note.push(input);
    res.status(200).send(games);
  }
};
